import React from 'react';
import OIP from '../../assetes/OIP.jpg'; // Adjust the path if necessary

const Dashboard = () => {
    const contacts =[
        {
            name:'sanika',
            status:'Available',
            img:OIP
        },
        {   
            name:'rutu',
            status:'Available',
            img:OIP
        },
        {
            name:'anu',
            status:'Available',
            img:OIP
        },
        {
            name:'shweta',
            status:'Available',
            img:OIP
        },
        {
            name:'rahi',
            status:'Available',
            img:OIP
        },
        {
            name:'shrisha',
            status:'Available',
            img:OIP
        },
        {
            name:'yogesh',
            status:'Available',
            img:OIP
        },
        {
            name:'manasvi',
            status:'Available',
            img:OIP
        },
        {
            name:'vaishu',
            status:'Available',
            img:OIP
        }
    ]
    return (
        <div className='w-screen flex'>
            <div className='w-[25%] border  h-screen bg-secondary'>
                <div className='flex justify-center items-center my-8'>
                  <div className='border border-primary p-[2px] rounded-full'>  <img src={OIP} width={75} height={75} alt="User" /></div>
                    <div className='ml-8'>
                        <h3 className='text-2xl'>Tutorials Dev</h3> {/* Add content to h3 */}
                        <p className='text-lg font-light'>My Account</p>
                    </div>
                </div>
                <hr />
                <div>
                    <div>Messages</div>
                    <div>
                        {
                            contacts.map(({name,status,img}) =>{
                           

                                return(
                                    <div className='flex items-center  my-8'>
                  <div className='border border-primary p-[2px] rounded-full'>  <img src={img} width={75} height={75} alt="User" /></div>
                    <div className='ml-8'>
                        <h3 className='text-lg'>{name}</h3> {/* Add content to h3 */}
                        <p className='text-sm font-light'>{status}</p>
                    </div>
                </div>
                                )
                            }
                         )
                        }
                    </div>
                </div>
            </div>
            <div className='w-[50%] border  h-screen'></div> {/* Corrected class names */}
            <div className='w-[25%] border  h-screen'></div> {/* Corrected class names */}
        </div>
    );
}

export default Dashboard;
